 import {SALT_RETURNS,Dialog} from '../actions/types';


 const initialState = {
    saltReturns:null,
    open:false,
};

export default function(state=initialState, action) { 
//  console.log("SALT_RETURNS",action.payload);
switch(action.type){
    case SALT_RETURNS:
    return {
        ...state,
        saltReturns:action.payload,
        
        
    };
    case Dialog:
    return{
        ...state,
        open:action.payload
    };
    default:
        return state;
 }
}
